pragma solidity 0.5.12;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20Detailed.sol";
import "@openzeppelin/contracts/ownership/Ownable.sol";
import "./IPrivateCompany.sol";

contract PrivateCompany is ERC20Detailed, ERC20, Ownable {event __CoveragePrivateCompany(string fileName, uint256 lineNumber);
event __FunctionCoveragePrivateCompany(string fileName, uint256 fnId);
event __StatementCoveragePrivateCompany(string fileName, uint256 statementId);
event __BranchCoveragePrivateCompany(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoveragePrivateCompany(string fileName, uint256 branchId);
event __AssertPostCoveragePrivateCompany(string fileName, uint256 branchId);

    constructor(address intendedOwner, string memory name, string memory symbol)
    //for simplicity, all company share tokens have 18 decimals (wei)
    ERC20Detailed(name, symbol, 18)
    public {emit __FunctionCoveragePrivateCompany('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompany.sol',1);

        //Ownable by default sets msg.sender(Factory) as owner which we might not want
emit __CoveragePrivateCompany('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompany.sol',13);
        emit __StatementCoveragePrivateCompany('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompany.sol',1);
_transferOwnership(intendedOwner);
    }

    function mint(uint256 value) public onlyOwner{emit __FunctionCoveragePrivateCompany('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompany.sol',2);

emit __CoveragePrivateCompany('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompany.sol',17);
        emit __StatementCoveragePrivateCompany('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompany.sol',2);
_mint(msg.sender, value);
    }

}
